meta._wpb_post_custom_css:
.button.main{
    color:#fff !important;
    border-color:rgba(255,255,255,0.6) !important;
}
ul.vibe_filterable {
    position: absolute;
    top: 5px;
    right: 0;margin:0;padding:0
}

ul.vibe_filterable a {
    padding: 0;
    background: none;
    border: none;
    font-size:16px;
    text-transform:none;
}
ul.vibe_filterable a:hover,
ul.vibe_filterable .active a {color:#f15b2a;background:none;}
ul.vibe_filterable .active a:before{content:'- ';}
.block.simple .block_content{padding:0 15px;}

.vibe_grid   .block_media > a {
    display: inline-block;
    width: 100%;
        min-height: 120px;
    max-height: 200px;
    overflow: hidden;
    border-bottom: 4px solid #f15b2a;
    border-radius: 5px 5px 0 0;
}

.member_block {
    position: relative;
}

.member_info {
    position: absolute;
    bottom: 0;
}

.member_info h3 a {
    color: #fff;
    padding: 10px 15px;
    background: #f15b2a;
}
.eventon_events_list .eventon_list_event .desc_trig {
    background-color: #fff;
    border-color: #f15b2a !important;
}  

.member_grid>li:first-child{grid-column:1/3;grid-row:1/3;}
.member_grid>li:last-child{grid-column:5/7;grid-row:1/3;}
@media(max-width:600px){
    .member_grid{grid-template-columns:repeat(auto-fit,minmax(320px,1fr));}
    .member_grid>li:first-child, .member_grid>li:last-child {
    grid-column: auto;grid-row:auto;}.member_info{display:none;}ul.vibe_filterable{position:relative;margin-bottom:15px;}
}

